webpackJsonp([0xe9a5cbcf242b],{344:function(e,a){e.exports={data:{project:{html:'<p>Fourplay mashed up Craigslist Missed Connection listings and Foursquare User data to bring users missed connections that happened near or at their check-ins.</p>\n<p>In order to achieve this we:</p>\n<ul>\n<li>scraped Craigslist Missed Connections with a <a href="https://scraperwiki.com/scrapers/ottawa_craigslist_missed_connections_1/">Python script</a></li>\n<li>analyzed each post for GPS data using the (now deprecated) Metalayer Text API</li>\n<li>then used the GPS information to locate and map locations using the Factual and <a href="https://developer.foursquare.com/">Foursquare</a> APIs</li>\n</ul>\n<p>My team was awarded the Metalayer API Award for our use of their API to analyze the missed connection data.</p>\n<h3>Press</h3>\n<ul>\n<li><a href="https://techcrunch.com/video/metalayer-gives-their-awards-to-sidewinder-fourplay-and-serendipity/">Metalayer Gives Their Awards to Sidewinder, Fourplay and Serendipity</a></li>\n</ul>',frontmatter:{title:"Fourplay",link:"https://techcrunch.com/video/fourplay-mashes-up-foursqaure-checkins-and-craigslist-missed-connections/",tags:["hackathon"],github:null,image:null,created:"May 2012"}}},pathContext:{slug:"/projects/fourplay/"}}}});
